} Let's explain some of the fields: kind: sell or buy status: Is always pending when creating a new order amount: 0 for when we want to sell with at market price, otherwise the amount in satoshis created_at: No need to send the correct unix timestamp, Mostro will replace it with the current time The event to send to Mostro would look like this: { "id": "cade205b849a872d74ba4d2a978135dbc05b4e5f483bb4403c42627dfd24f67d", "kind": 1059, "pubkey": "1f5bb148a25bca31506594722e746b10acf2641a12725b12072dcbc46ade544d", // Seller's ephemeral pubkey "content": "sealed-rumor-content", "tags": [ ["p", "dbe0b1be7aafd3cfba92d7463edbd4e33b2969f61bd554d37ac56f032e13355a"] // Mostro's pubkey ], "created_at": 1234567890, "sig": "a21eb195fe418613aa9a3a8a78039b090e50dc3f9fb06b0f3fe41c63221adc073a9317a1f28d9db843a43c28d860ba173b70132ca85b0e706f6487d43a57ee82"
}

